import React from "react";
import {Button, Icon} from 'antd';

const settings = {
  position: 'absolute',
  top: '50%',
  right: 0,
};

const AntSetting = () => (
  <Button type="primary" size="small" style={settings}>
    Primary
  </Button>
);

export default AntSetting;
